func TestArray_CopyWithin(t *testing.T) {
	type args struct {
		target int
		start  int
		end    int
	}
	tests := []struct {
		name string
		pa   *Array
		args args
		want []interface{}
	}{
		{
			name: "test 1",
			pa:   NewArray(array1),
			args: args{3, 2, 4},
			want: []interface{}{1, 2, 3, 3, 4, 4, 6},
		},
		{
			name: "test 2",
			pa:   NewArray(array1),
			args: args{-13, -22, -44},
			want: []interface{}{1, 2, 3, 4, 5, 4, 6},
		},
		{
			name: "test 3",
			pa:   NewArray(array1),
			args: args{16, 2, 5},
			want: []interface{}{1, 2, 3, 4, 5, 4, 6},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			// tt.pa.CopyWithin(tt.args.target, tt.args.start, tt.args.end)
			// got := tt.pa.GetResult()
			got := tt.pa.CopyWithin(tt.args.target, tt.args.start, tt.args.end)

			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("Array.CopyWithin() = %v, want %v", got, tt.want)
			}
		})
	}
}

